import "./App.css";
import allCountryScores from "./score";

function App() {
  return (
    <div className="App">
      <h1>High Score Per Country</h1>
      <MakeList />
    </div>
  );
}

function MakeList() {
  return (
    <div>
      {allCountryScores
        .sort((a, b) => (
          <h2>HIGH SCORES:{a.country.localeCompare(b.country)}</h2>
        ))
        .scores.map((element) => (
          <div>
            <ul>
              (
              <li>
                {element.n} {element.s}{" "}
              </li>
              )
            </ul>
          </div>
        ))}
    </div>
  );
}

function CountryName(country) {
  var sortOrder = 1;

  if (country[0] === "-") {
    sortOrder = -1;
    country = country.substr(1);
  }

  return function (a, b) {
    if (sortOrder === -1) {
      return <h2>{b[country].localeCompare(a[country])}</h2>;
    } else {
      return <h2>{a[country].localeCompare(b[country])}</h2>;
    }
  };
}
export default App;
